import './sidebar.css'
import avt from '../../../img/avt.jpg';
import Item from './item';
import { faHouse, faMessage, faCalendar, faTag, faFile, faGear } from '@fortawesome/free-solid-svg-icons'

function Sidebar() {
    return (
        <div className="sidebar">
            <div className="circle-container">
                <img src={avt} alt="" className="circle-image"></img>
            </div>
            <label>Name</label>
            <Item
                id="PROPERTIES"
                icon={faHouse}
                title="PROPERTIES"
            />
            <Item
                id="CHAT"
                icon={faMessage}
                title="CHAT"
            />
            <Item
                id="CALENDER"
                icon={faCalendar}
                title="CALENDER"
            />
            <Item
                id="OFFERS"
                icon={faTag}
                title="OFFERS"
            />
            <Item
                id="DOCUMENTS"
                icon={faFile}
                title="DOCUMENTS"
            />
            <Item
                id="PROPERTIES"
                icon={faGear}
                title="SETTINGS"
            />
        </div>
    );
}

export default Sidebar;
